            <div className="main">
                <div className='item2'>
                    <img src={img1} alt="" /></div>
                <div className='item3'>
                    <div className='intro'>

                        <h1>Neha Shah </h1>
                        <p>Frontend Developer / Designer</p>
                        <p>ns457989@gmail.com</p>
                        <p>Dharan,Nepal</p>
                    </div>
                    </div>
            </div>
        </>
    )
}

export default Home;
